import React, { useState } from "react";
import { useEffect } from "react";
import rockstar from "./image/rockstar.png";
import "./Register.css";

const Register = () => {
  const initialValues = { name: "", username:"", email: "", number:""  };
  const [formValues, setFormValues] = useState(initialValues);
  const [formErrors, setFormErrors] = useState({});
  const [isSubmit, setIsSubmit] = useState(false);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormValues({ ...formValues, [name]: value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    setFormErrors(validate(formValues));
    setIsSubmit(true);
  };

  useEffect(() => {
    console.log(formErrors);
    if (Object.keys(formErrors).length === 0 && isSubmit) {
      console.log(formValues);
    }
  }, [formErrors]);
  const validate = (values) => {
    const errors = {};
    const regex = /^[^\s@]+@[^\s@]+\.[^\s@]{2,}$/i;
    if (!values.username) {
      errors.username = "Username is required!";
    }
    if (!values.email) {
      errors.email = "Email is required!";
    } else if (!regex.test(values.email)) {
      errors.email = "This is not a valid email format!";
    }
    if (!values.password) {
      errors.password = "Password is required";
    } else if (values.password.length < 4) {
      errors.password = "Password must be more than 4 characters";
    } else if (values.password.length > 10) {
      errors.password = "Password cannot exceed more than 10 characters";
    }
    return errors;
  };
 

  

  return (
    <div className="register_page">
      <div className="left_container">
        <img src={rockstar} alt="" />
        <h1 className="discover">Discover New things on SuperApp</h1>
      </div>
      <div className="right_container">
        <h1 className="heading">Super App</h1>
        <p className="subheading">Create your New Account </p>

        {Object.keys(formErrors).length === 0 && isSubmit ? (
        <div className="ui message success">Signed in successfully</div>
      ) : (
        <pre>{JSON.stringify(formValues, undefined, 2)}</pre>
      )} 
      <form onSubmit={handleSubmit}>
        <h1>Login Form</h1>
        <div className="ui divider"></div>
        <div className="ui form">
          <div className="field">
            <label>name</label>
            <input
              type="text"
              name="name"
              placeholder="name"
              value={formValues.name}
              onChange={handleChange}
            />
          </div>
          <p>{formErrors.name}</p>
          <div className="field">
            <label>Username</label>
            <input
              type="text"
              name="username"
              placeholder="Username"
              value={formValues.username}
              onChange={handleChange}
            />
          </div>
          <p>{formErrors.username}</p>
          <div className="field">
            <label>Email</label>
            <input
              type="text"
              name="email"
              placeholder="Email"
              value={formValues.email}
              onChange={handleChange}
            />
          </div>
          <div className="field">
            <label>Number</label>
            <input
              type="text"
              name="number"
              placeholder="Number"
              value={formValues.email}
              onChange={handleChange}
            />
          </div>

          <p>{formErrors.email}</p>
         
          <button className="fluid ui button blue">Submit</button>
        </div>
      </form>
       
          

        <p className="heading2">
          By clicking on Sign up. you agree to Superapp{" "}
          <span className="span1">Terms and Conditions of Use</span>
          <br />
          To learn more about how Superapp collects, uses, shares and protects
          your personal data please head Superapp
          <span className="span2">Privacy Policy</span>
        </p>

        <p className="last_heading">
          To learn more about how Superapp collects, uses, shares and protects
          your personal data please head Superapp
          <span className="">Privacy Policy</span>
        </p>
      </div>
    </div>
  );
};

export default Register;
